import React from 'react';
import { Link } from 'react-router-dom';

const navbar = () => {
    return (
        <nav className="nav">
            <ul>
                <li><Link to='/'>Home</Link></li>
                <li><Link to='/phone'>Phones</Link></li>
                <li><Link to='/phones'>Add Phone</Link></li>
            </ul>
        </nav>
    )
}

export default navbar;


